import React from 'react';
import {Row, Col} from 'react-bootstrap';

export default class MovieDetail extends React.Component {
    constructor(props){
        super(props);
        this.state={
            id:props.match.params,
        }
    }
    render() {
        return (
             <div className="container">
                <Row>
                    <Col>
                    {this.state.id}
                    </Col>
                    <Col>

                    </Col>
                </Row>
             </div>
        );
    }
}
